import { FC } from "react";
import ToDo from "../models/todo";
import SingleToDo from "./SingleToDo";
const ToDos: FC<{
  items: ToDo[];
}> = (props) => {
  return (
    <ul>
      {props.items.map((item: any) => (
        <SingleToDo id={item.id} text={item.text} />
      ))}
    </ul>
  );
};

export default ToDos;
